import { BarChart, Bar, XAxis, YAxis, Tooltip, ResponsiveContainer } from "recharts";

const data = [
 
  { name: "Communication", value: 100 },
  { name: "Creative", value: 100 },
  { name: "Detail Oriented", value: 100 },
  { name: "Good Team Player", value: 100 },

  { name: "Problem Solving", value: 100 },
  { name: "Critical Thinking", value: 100 },
  { name: "Multitasking", value: 98 },
  { name: "Ability to work under pressure", value: 95 },
  { name: "Time Management", value: 90 },
];

// Debugging Check
console.log(data);
data.forEach((item) => console.log(item.name, typeof item.value)); // Should all be "number"

const Inter = () => {
  return (
    <div style={{ width: "100%", height: 400 }}>
      <h3><b>INTERPERSONAL INTER</b></h3>
      <h4 style={{ textShadow: "0 0 2px #fff, 0 0 4px #fff" }}>
        <b>KEY COMPETENCIES</b>
      </h4>
      <ResponsiveContainer width="100%" height={400}>
        <BarChart data={data} layout="vertical" margin={{ left: 50, right: 50 }}>
          <XAxis type="number" domain={[0, 100]} tickCount={6} allowDecimals={false} />
          <YAxis dataKey="name" type="category" width={180} tick={{ fontSize: 12 }} />
          <Tooltip />
          <Bar dataKey="value" fill="#4caf50" barSize={20} minPointSize={5} />
        </BarChart>
      </ResponsiveContainer>
    </div>
  );
};

export default Inter;
